import React from 'react';
import axios from 'axios';
import { Redirect } from 'react-router';
import { Link } from 'react-router-dom';
import {useLocation} from "react-router-dom";
import Settings from './Settings.js'
import {Route,PrivateRoute} from 'react-router-dom';
import { BrowserRouter as Router } from 'react-router-dom';
class Network extends React.Component {
	constructor(props) {
   		super(props);
  		this.state = {
	     	email: "",
	     	id:-1,
	     	con:false,
	     	user_search:"",
	    };
	    if(props.location.state == null){
    		this.state.con=false	
    	}
    	else{
    		this.state.con=true
    		this.state.email_address=props.location.state.Email
    		this.state.id=props.location.state.id
    	}
  	}
  	render(){
  		if(this.state.con === false ){
  			return (<Redirect to='/'/>);
  		}
  		else{
	  		return(
	  			<div>
	  			<h1>My Network</h1>
			    <label>Search User:</label>
	  			<input type="text"  id="search_name" name="search_name" size="61"/><br/>
	  			</div>
	  		);
	  	}
  	}
}
export default Network;
